        This device was clearly built to last.\r\n\r\nA cursory analysis of the software
        systems within reveals that it operates as some kind of monitoring device.
        The specialized design suggests it was used to process vast amounts of basic
        data and identify anomalies.\r\n\r\nGiven its age and unique design, there
        would likely be very few who could make sense of the programming. Those who
        do recognize the value of such a component, however, would likely be willing
        to part with a significant sum of ISK to own it. ","group_id":880,"icon_id":3755,"market_group_id":1109,"mass":1.0,"name":"Neural
